import React from "react";
import styles from "./DiaryProductsList.module.css";

const DiaryProductsList = ({ consumedFoods = [] }) => { // ✅ Implicit este array gol
    if (!Array.isArray(consumedFoods)) {
        console.error("consumedFoods is not an array:", consumedFoods);
        return null; // ✅ Evităm eroarea și prevenim randarea listei goale
    }

    return (
        <div className={styles.productsListContainer}>
            <h3>Consumed Products</h3>
            {consumedFoods.length === 0 ? (
                <p>No products added yet.</p> // ✅ Mesaj de fallback dacă lista e goală
            ) : (
                <ul className={styles.productsList}>
                    {consumedFoods.map((food, index) => (
                        <li key={index}>
                            {food.name} - {food.weight}g - {food.calories} kcal
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
};

export default DiaryProductsList;
